css:
.conflict-resolved {
  background: rgba(0, 0, 0, 0.1);
}
.conflict-ours {
  background: rgba(112, 202, 87, 0.4);
}
.conflict-ours.cursor-line {
  background: rgba(112, 202, 87, 0.3);
}
.conflict-theirs {
  background: rgba(21, 122, 251, 0.4);
}
.conflict-theirs.cursor-line {
  background: rgba(21, 122, 251, 0.3);
}
.conflict-base {
  background: rgba(247, 165, 80, 0.4);
}
.conflict-base.cursor-line {
  background: rgba(247, 165, 80, 0.3);
}
.conflict-dirty {
  background: rgba(245, 225, 29, 0.4);
}
.conflict-dirty.cursor-line {
  background: rgba(245, 225, 29, 0.3);
}
